import { faAngleRight, faMicrophoneLines } from '@fortawesome/free-solid-svg-icons'

import '../styling/remix.css';

import RemixComponent from './remixComponent';

import Ctrl from '../ctrl.jpg';

const Remix = () => {  
  return(
    <Box
      id='remix-window'
    >
      <Typography id='remixes'>Stem Remix</Typography>
      <Box>
        <Box>
          <FontAwesomeIcon icon={faAngleRight} />
          Vocals
